import * as o from "react";
import t from "../lib/IconBase.es.js";
import n from "../defs/Acorn.es.js";
const r = o.forwardRef((c, e) => /* @__PURE__ */ o.createElement(t, { ref: e, ...c, weights: n }));
r.displayName = "AcornIcon";
const s = r;
export {
  s as Acorn,
  r as AcornIcon
};
